			"category" : "Instructions",
			"categoryID" : 66,
			"keyword" : "",
			"sectionID" : 59,
			"text" : "any dry wells, irrigation wells, injection wells, abandoned wells, monitoring wells, supply wells, or other wells<BR>",
			"showInPage" : true,
			"sectionGUID" : "9bc227d5-dd48-11e5-b5c1-0e29ed3d2a45",
