			"categoryID" : 65,
			"keyword" : "HVAC Observed",
			"sectionID" : 103,
			"text" : "\n\n<font color=\"#ff0000\">####</font> Heating, Ventilation, and Air Conditioning (HVAC) unit<font color=\"#ff0000\">(s)</font> <font color=\"#ff0000\">was////were</font> observed on the subject property at the time of the site reconnaissance. The HVAC unit<font color=\"#ff0000\">(s)</font> appeared to be in <font color=\"#ff0000\">good</font> condition with <font color=\"#ff0000\">no</font> indications of leaking or staining. Based on condition of the HVAC unit<font color=\"#ff0000\">(s)</font> and <font color=\"#ff0000\">no</font> indications of leaking or staining, the HVAC unit<font color=\"#ff0000\">(s)</font> <font color=\"#ff0000\">is////are</font> not a recognized environmental condition to the subject property.\n\n\n\n",
