			"languageGUID" : "0aa85c84-fec4-11e5-95e5-0e29ed3d2a45",
			"category" : "Options",
			"categoryID" : 65,
			"keyword" : "No pits, ponds, or lagoons were observed",
			"sectionID" : 56,
			"text" : "No pits, ponds, or lagoons were observed on the subject property at the time of the site reconnaissance. However, a shallow, dry retention pond was observed directly east and northeast of the subject property. The retention pond appeared to be used for runoff from the fire station and nearby drainage ditch to drain into until the water evaporates. Based on no observed dumping, stains, and the area not located within a flood zone, the shallow, dry, retention pond is not a recognized environmental condition to the subject property.",
