			"categoryID" : 65,
			"keyword" : "Yes - Transformer(s)",
			"sectionID" : 53,
			"text" : "\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt;\"><font color=\"#ff0000\">####</font><span>&nbsp;</span><font color=\"#ff0000\">pole////pad</font>-mounted electrical transformer<font color=\"#ff0000\">(s)</font><span>&nbsp;</span><font color=\"#ff0000\">was////were</font>&nbsp;observed on the subject\nproperty. The transformer<font color=\"#ff0000\" face=\"Arial, sans-serif\">(s)</font><span>&nbsp;</span><font color=\"#ff0000\">is////are</font><span>&nbsp;</span><span>owned and maintained by\nthe local utility and appeared to be in<span>&nbsp;</span></span><font color=\"#ff0000\">good</font><span>&nbsp;</span><span>condition at the time of\nthe site reconnaissance, with<span>&nbsp;</span></span><font color=\"#ff0000\">no</font><span>&nbsp;</span><span>indications of leaking or\nstaining observed on or below the transformer casing</span><font color=\"#ff0000\">(s)</font>.<span>&nbsp;</span>No labels were observed\nregarding the polychlorinated biphenyl (PCB)-status of the transformer<font color=\"#ff0000\">(s)</font>\n<font color=\"#ff0000\">////OR</font> The transformer<font color=\"#ff0000\">(s)</font> <font color=\"#ff0000\">was///were</font> labeled non-PCB. In the event of a release of dielectric fluid from the\ntransformer<span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\ncolor:red\">(s)</span>, the local utility should be contacted to perform\nany associated clean-up. The<span>&nbsp;</span><font color=\"#ff0000\">pole////pad</font>-mounted transformer<span style=\"font-family:\n&quot;Arial&quot;,&quot;sans-serif&quot;;color:red\">(s)</span><span>&nbsp;</span><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\ncolor:red\">is////are</span><span>&nbsp;</span><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\ncolor:red\">not</span><span>&nbsp;</span><span>a recognized environmental\ncondition to the subject property.</span></p>\n\n",
