			"languageGUID" : "0aa85c84-fec4-11e5-95e5-0e29ed3d2a45",
			"category" : "Options",
			"categoryID" : 65,
			"keyword" : "No evidence of anything",
			"sectionID" : 196,
			"text" : "\n<p>This assessment has revealed no evidence of recognized environmental conditions, historical recognized environmental conditions, controlled recognized environmental conditions, or potential environmental concerns in connection with the subject property.</p>\n\n",
			"showInPage" : false,
			"sectionGUID" : "9bc25af4-dd48-11e5-b5c1-0e29ed3d2a45",
			"orderIndex" : 2,
