			"keyword" : "Build - Raw land",
			"sectionID" : 554,
			"text" : "<p style=\"\">The proposed activities at the subject property include the construction of a <font color=\"#ff0000\">293' self-support tower, associated telecommunications compound, and access road</font>. Site plans can be referenced in Appendix A.</p>",
