			"category" : "Instructions",
			"categoryID" : 66,
			"keyword" : "Instructions",
			"sectionID" : 64,
			"text" : "\n\n\nChoose which \"Zone\" from the default language menu the subject property is in.<br>Then change to the correct County.\n\n\n\n\n\n",
			"showInPage" : true,
			"sectionGUID" : "9bc22b17-dd48-11e5-b5c1-0e29ed3d2a45",
