			"languageGUID" : "0aa85c84-fec4-11e5-95e5-0e29ed3d2a45",
			"category" : "Options",
			"categoryID" : 65,
			"keyword" : "City Dir & Sanborn Available",
			"sectionID" : 38,
			"text" : "<p style=\"\">City directories list businesses and residences by street address within incorporated city limits. City Directories are included in Appendix D, Historical Research Documentation.&nbsp;City directories dated&nbsp;<font color=\"#ff0000\">1969, 1974, 1979, and 2002</font>&nbsp;were provided by EDR and reviewed.</p><p>&nbsp;</p><ul><li><font color=\"#ff0000\">The subject property address is not listed for 1969, 1974, and 1979. In 2002, the subject property address is listed as Taylor Lake Village City.</font></li></ul><p>&nbsp;</p><ul><li><font color=\"#ff0000\">Nearby properties were listed as residential, commercial, and a recreational park for 1969, 1974, 1979, and 2002.</font></li></ul><p>&nbsp;</p><p style=\"\">The city directory review&nbsp;<font color=\"#ff0000\">did not</font>&nbsp;indicate evidence of recognized environmental conditions, historical recognized environmental conditions, or potential environmental concerns associated with the subject property and surrounding properties.</p><p>&nbsp;</p><p style=\"\">Fire insurance maps indicate historical land uses in urban areas, particularly with respect to flammable substance use or storage. Fire insurance maps are&nbsp;included in Appendix D, Historical Research Documentation. <font color=\"#333333\">Fire in</font>surance map,&nbsp;were provided by EDR and reviewed.</p><p>&nbsp;</p><ul><li><font color=\"#ff0000\">1970 Sanborn Map: The subject property is depicted as raw land, used for trailer parking. A structure labeled as Auto Repair is depicted on the southern portion of the parent tract. Surrounding properties are depicted as commercial and industrial properties, including multiple auto repair facilities.</font></li></ul><p>&nbsp;</p><p style=\"\">The fire insurance map review&nbsp;<font color=\"#ff0000\">did not</font>&nbsp;indicate evidence of recognized environmental conditions, historical recognized environmental conditions, or potential environmental concerns associated with the subject property and surrounding properties.</p>",
