			"sectionID" : 38,
			"text" : "<p style=\"\">City directories list businesses and residences by street address within incorporated city limits. Fire insurance maps indicate historical land uses in urban areas, particularly with respect to flammable substance use or storage.&nbsp;<font color=\"#ff0000\">According to EDR, fire insurance maps are not available for the subject property area</font>. City Directories and Fire Insurance Maps are included in Appendix D, Historical Research Documentation.&nbsp;City directories dated&nbsp;<font color=\"#ff0000\">1969, 1974, 1979, and 2002</font>&nbsp;were provided by EDR and reviewed.</p><p>&nbsp;</p><ul><li><font color=\"#ff0000\">The subject property address is not listed for 1969, 1974, and 1979. In 2002, the subject property address is listed as Taylor Lake Village City.</font></li></ul><p>&nbsp;</p><ul><li><font color=\"#ff0000\">Nearby properties were listed as residential, commercial, and a recreational park for 1969, 1974, 1979, and 2002.</font></li></ul><p>&nbsp;</p><p style=\"\">The city directory review&nbsp;<font color=\"#ff0000\">did not</font>&nbsp;indicate evidence of recognized environmental conditions, historical recognized environmental conditions, or potential environmental concerns associated with the subject property and surrounding properties.</p>",
