			"text" : "<p><font color=\"#ff0000\">Benchmark's site&nbsp;reconnaissance&nbsp;and review of the environmental database did not identify any conditions on site or on adjoining properties that would indicate a recognized environmental condition relative to vapor migration existing at the subject property. The scope of this screening was limited to visual&nbsp;observations and a review of the environmental database report and did not include the collection and laboratory analysis of air samples to&nbsp;confirm&nbsp;the presence of airborne contaminants by vapor&nbsp;intrusion.</font></p><p><font color=\"#ff0000\"><br/></font></p><p><font color=\"#ff0000\">OR///A vapor encroachment condition (VEC) exists //// likely exists //// cannot be ruled out at the subject property due to xxxxx. Further information and the Vapor Encroachment Screen can be found in Appendix G, Vapor Encroachment Evaluation.</font></p>",
