			"sectionID" : 115,
			"text" : "<ul><li>Based on a review of information obtained from Federal Emergency Management Agency (FEMA) on-line and the National Flood Insurance Program (NFIP) Community Flood Insurance Rate Map Panel <font color=\"#ff0000\">#48201C0670L</font>, dated <font color=\"#ff0000\">June 18, 2007</font>, the subject property is located in Zone \"AE\", areas subject to inundation by the 1-percent-annual-chance flood event (or 100-year flood) determined by detailed methods. Base Flood Elevations (BFEs) are shown. Mandatory flood insurance purchase requirements and floodplain management standards apply.</li></ul>",
