			"sectionID" : 115,
			"text" : "<ul><li>Based on a review of information obtained from Federal Emergency Management Agency (FEMA) on-line and the National Flood Insurance Program (NFIP) Community Flood Insurance Rate Map Panel<font color=\"#ff0000\"> #4855140030C</font>, dated <font color=\"#ff0000\">May 2, 1983</font>, the subject property is located in Zone \"B /// X (shaded)\", areas of moderate flood hazard, usually between the limits of the 100-year and 500-year floods and used to designate base floodplains of lesser hazards, such as areas protected by levees from 100-year flood, or shallow flooding areas with average depths of less than one foot or drainage areas less than one square mile.</li></ul>",
