			"sectionID" : 115,
			"text" : "<ul><li>No evidence of recognized environmental conditions, historical recognized environmental conditions, or potential environmental concerns in connection with the subject property. The use of the subject property as farmland indicates potential use of agricultural chemicals such as pesticides, herbicides, and fertilizers at the subject property; however, proper use of agricultural chemicals is considered a de minimis condition and not a release under CERCLA; therefore, not a recognized environmental condition to the subject property.</li></ul>",
