			"category" : "Options",
			"categoryID" : 65,
			"keyword" : "Transformers",
			"sectionID" : 249,
			"text" : "<FONT COLOR=#ff0000>####</font><span>&nbsp;</span><FONT COLOR=#ff0000>pole////pad</font><span>-mounted electrical transformer</span><FONT COLOR=#ff0000>(s)</font><span>&nbsp;</span><FONT COLOR=#ff0000>was////were</font><span>&nbsp;observed approximately&nbsp;</span><span><FONT COLOR=#ff0000>XXXX '</font></span><span>&nbsp;to the&nbsp;</span><span><FONT COLOR=#ff0000>south</font></span><span>&nbsp;of the subject property. The transformer</span><FONT COLOR=#ff0000>(s)</font><span>&nbsp;</span><FONT COLOR=#ff0000>is////are</font><span>&nbsp;</span><span>owned and maintained by the local utility and appeared to be in&nbsp;</span><FONT COLOR=#ff0000>good</font><span>&nbsp;</span><span>condition at the time of the site reconnaissance, with&nbsp;</span><FONT COLOR=#ff0000>no</font><span>&nbsp;</span><span>indications of leaking or staining observed on or below the transformer casing</span><FONT COLOR=#ff0000>(s)</font><span>.</span><span>&nbsp;</span><span>No labels were observed regarding the polychlorinated biphenyl (PCB)-status of the transformer</span><FONT COLOR=#ff0000>(s)</font><span>&nbsp;</span><FONT COLOR=#ff0000>////OR</font><span>&nbsp;The transformer</span><FONT COLOR=#ff0000>(s)</font><span>&nbsp;</span><FONT COLOR=#ff0000>was///were</font><span>&nbsp;labeled non-PCB. In the event of a release of dielectric fluid from the transformer</span><span><FONT COLOR=#ff0000>(s)</font></span><span>, the local utility should be contacted to perform any associated clean-up. The</span><span>&nbsp;</span><FONT COLOR=#ff0000>pole////pad</font><span>-mounted transformer</span><FONT COLOR=#ff0000><span>(s)</span><span>&nbsp;</span><span>is////are</span></font><span>&nbsp;</span><span>not</span><span>&nbsp;</span><span>a recognized environmental condition to the subject property.</span>",
			"showInPage" : false,
			"sectionGUID" : "9bc26ef1-dd48-11e5-b5c1-0e29ed3d2a45",
			"orderIndex" : 1,
			"libraryID" : 0,
			"languageItemGuid" : "d034c055-f451-ae38-2380-f69fd54bbf91",
