			"text" : "<font color=\"#FF0000\">[Be sure to review with NR team] <br/><br/>During the site visit the subject property was noted to be very wet (standing water, mud) with indications of past flooding (flood debris).  Numerous wetlands plants were also observed. When standing water and mud are observed on a property it is assumed that wetlands soils are present. Wetlands are present if wetlands hydrology, plants and soils are present on a property. The presence of wetlands on a property constitutes an Environmental Concern. A wetlands delineation is recommended to confirm or deny is jurisdictional waters (including wetlands) are present on the subject property.   \n\n</font>",
